import React from 'react';
import styles from './LandingComponent.module.css'
import { Grid, Image, Segment } from 'semantic-ui-react'

interface Props {
  name: string
}

interface State {
  count: number
  developerName: string
}

export class LandingComponent extends React.Component<{}, State> {

  constructor(props: {}) {
    super(props)
  }

  render() {
    return (
      <>
      <Grid>
        <Grid.Column width={4} />
        <Grid.Column width={8}>
          <Segment className={styles.MainCard} padded='very' piled >Very padded content.</Segment>
        </Grid.Column>
      </Grid>
      </>
    )
  }
}
